// SPDX-License-Identifier: UNLICENSED

// DO NOT MODIFY BELOW THIS
pragma solidity ^0.8.17;

import "hardhat/console.sol";

contract Splitwise {
    // DO NOT MODIFY ABOVE THIS

    // ADD YOUR CONTRACT CODE BELOW

    mapping (address => mapping(address => uint32) ) amountOwe;

    address[] user; 

    mapping (address => uint) tickUser;

    uint countUser;

    function lookup(address debtor, address creditor) public view returns (uint32) {
        return amountOwe[debtor][creditor];   
    }
    uint32 [][] amountOweNow;

    function findCycle() public returns(uint32 [][] memory ) {

      //  mapping(address => mapping (address => uint32) ) memory amountOweNow;

        for (uint32 i=0; i < countUser; i++)
        {
            for(uint32 j=0; j<countUser; j++)
            {
                if(amountOwe[user[i]][user[j]] > 0)
                    amountOweNow[i].push(j);
            }
        }
        return amountOweNow;
    }

    function addIOU(address creditor, uint32 amount) external returns (bool) {
        if (tickUser[creditor] == 0) tickUser[creditor] = ++countUser;
        if (tickUser[msg.sender] == 0) tickUser[msg.sender] = ++countUser;
        amountOwe[msg.sender][creditor] += amount; 

        return true;
    }

    function getUser () public view returns (address[] memory) {
        return  user;
    }

    function getTotalOwed(address userOwe) public view returns(uint32) {
        uint32 total = 0;
        for (uint i = 0;i <countUser ;i++) {
            total += amountOwe[userOwe][user[i]];
        }

        return total;
    }

}

